import { DateTime, Interval } from 'luxon';
import Srand from 'seeded-rand';
import { alternadesList } from './store';

export function getAlternades(): string[] {
    return alternades;
}

export function getNonAlternades(): string[] {
    return nonAlternades;
}

export interface ListEntry {
    wordOne: string;
    wordTwo: string;
    wordThree: string;
    wordFour: string;
};

export function getSeed() {
    const date = DateTime.now().startOf('day');
    const date2 = DateTime.fromISO('2000-01-01T00:00').startOf('day');
    const diff = Interval.fromDateTimes(date2, date);

    return diff.length('days');
}

export function generateWordList(): ListEntry[] {
    const wordList: ListEntry[] = [];

    const rand = new Srand();
    rand.seed(getSeed());

    const words: string[] = rand.sample(getNonAlternades(), 30);
    const alternades: string[] = rand.sample(getAlternades(), 10);
    alternadesList.set(alternades);

    for (let i = 0; i < alternades.length; i++) {

      const entries = rand.shuffle([words.pop(), words.pop(), words.pop(), alternades[i]]);

      const entry = {
        wordOne: entries[0],
        wordTwo: entries[1],
        wordThree: entries[2],
        wordFour: entries[3]
      } as ListEntry;

      wordList.push(entry);
    }

    return wordList;
  }


